    <style>
      body,
      html {
        margin: 0;
        width: 100%;
        height: 100%;
        overflow: hidden;
        font-synthesis: none;
        text-rendering: optimizeLegibility;
        -webkit-font-smoothing: antialiased;
        -moz-osx-font-smoothing: grayscale;
      }
      .bg-color {
        background-color: #ffffff;
      }
      @media (prefers-color-scheme: dark) {
        .bg-color {
          background-color: #292f36;
        }
      }
      @keyframes fade-in {
        0% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      .show-after-init {
        visibility: hidden;
        animation: fade-in 1s ease-out;
      }
      .flex {
        display: flex;
      }
      .flex.flex-row {
        flex-direction: row;
      }
      .flex.items-center {
        align-items: center;
      }
      .flex.justify-center {
        justify-content: center;
      }
      .bezel {
        display: inline-block;
        border-width: 2rem;
        border-style: solid;
        border-color: #dfe6eb;
        overflow: hidden;
      }
      @media (prefers-color-scheme: dark) {
        .bezel {
          border-color: #1e2229;
        }
      }
      .bezel-classic {
        background: linear-gradient(
          45deg,
          #000000 45%,
          #2e2e2e 47%,
          #000000 55%
        );
      }
      .rounded-lg {
        border-radius: 0.5rem;
      }
      .rounded-full {
        border-radius: 9999px;
      }
      .ring {
        outline: solid 1px #aeb4b7;
      }
      @media (prefers-color-scheme: dark) {
        .ring {
          outline: solid 1px #46505c;
        }
      }
      canvas {
        animation: fade-in 0.3s linear;
        display: block;
        aspect-ratio: (800 / 480);
      }
    </style>

function getBinarySync(file) {
